text.inkscape:label:
{"align":"Right","attr":"set","prompt":"","src":"var loc="rio de janeiro";var obj = thisobj;
setInterval( function() {
$.getJSON('../htdocs/proxy.php?TYPE=application/json&URL=http%3A%2F%2Fapi.openweathermap.org%2Fdata%2F2.5%2Fweather%3Fq%3D'+loc+'%2Cbr%26amp%3Bunits%3Dmetric%26amp%3Blang%3Dpt%26amp%3BAPPID%3Dba5a5a44279f9c8d124246f1147c2bed', function(data){
 if ( typeof(data.main)!="undefined" )
 obj.textContent=parseFloat(data.main.temp).toFixed(0)+"°";
 if ( typeof(data.weather)!="undefined" )
 {
 var objuse = window.SVGDoc.getElementById( "wt_" + loc.replace(/ /g , "_") );
 if ( objuse )
 objuse.setAttributeNS( "http://www.w3.org/1999/xlink" , "href", "#" + data.weather[0].icon );
 }
 });
}, 19000 ); ","tag":"#exec","type":"Data"}
